import React from 'react';
import './App.css';
import Nav from './Nav/Nav'
import Cennik from './Cennik/Cennik';
import Kontakt from './Kontakt/Kontakt';
import Main from './Main/Main'
import {BrowserRouter} from 'react-router-dom'

function App() {
  return (
    <div>
      <BrowserRouter>
      <Nav />
      <Main />
      </BrowserRouter>
      </div>
  );
}

export default App;
